import React from 'react';
import './App.css';
import GlowingButton from './GlowingButton'; // Import the GlowingButton component

function App() {
  // Handle button click event
  const handleClick = () => {
    alert('Button clicked!');
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My Glowing Button Demo</h1>
        <p>Click the glowing button below:</p>

        {/* Use the GlowingButton component */}
        <GlowingButton text="Click Me!" onClick={handleClick} />

        <p>Feel free to modify the button or add more features!</p>
      </header>
    </div>
  );
}

export default App;
